import React from "react";
import TodoListItem from "./todo-list-item";

const TodoList = ({todos}) => {
    const items = todos.map((item) => {

        const {id, ...itemPr} = item

        return(
            <li key={item.id}>
                <TodoListItem {...item} />
            </li>
        );
    });
    return (
      <ul>
        {items}
      </ul>
    );
};

export default TodoList;
